We use a Pythonic way to parse the JSON-files and obtain the vertices and edges of the graphs, provided vertex and edge schemas, respectively. # Pythonic way of doing it, parsing a JSON graph representation.
# Creates vertices with the graph id, object name and id, optionally includes the attibutes
def json_to_vertices_edges(graph_json, scene_graph_id, include_object_attributes=False): vertices = [] edges = [] obj_id_to_name = {} vertex_ids = graph_json['objects'] for vertex_id in vertex_ids: vertex_obj = graph_json['objects'][vertex_id] name = vertex_obj['name'] vertices_data = [scene_graph_id, vertex_id, name] if vertex_id not in obj_id_to_name: obj_id_to_name[vertex_id] = name if include_object_attributes: attributes = vertex_obj['attributes'] vertices_data.append(attributes) vertices.append(tuple(vertices_data)) for relation in vertex_obj['relations']: src = vertex_id dst = relation['object'] name = relation['name'] edges.append([src, dst, name]) for i in range(len(edges)): src_type = obj_id_to_name[edges[i][0]] dst_type = obj_id_to_name[edges[i][1]] edges[i].append(src_type) edges[i].append(dst_type) return (vertices, edges) def parse_scene_graphs(scene_graphs_json, vertex_schema, edge_schema): vertices = [] edges = [] # if vertice_schema has a field for attributes: include_object_attributes = len(vertex_schema) == 4 for scene_graph_id in scene_graphs_json: vs, es = json_to_vertices_edges(scene_graphs_json[scene_graph_id], scene_graph_id, include_object_attributes) vertices += vs edges += es vertices = spark.createDataFrame(vertices, vertex_schema) edges = spark.createDataFrame(edges, edge_schema) return GraphFrame(vertices, edges) from pyspark.sql.types import StructType, StructField, ArrayType, IntegerType, StringType # create schemas for scene graphs:
vertex_schema = StructType([ StructField("graph_id", StringType(), False), StructField("id", StringType(), False), StructField("object_name", StringType(), False)
]) vertex_schema_with_attr = StructType([ StructField("graph_id", StringType(), False), StructField("id", StringType(), False), StructField("object_name", StringType(), False), StructField("attributes", ArrayType(StringType()), True)
]) edge_schema = StructType([ StructField("src", StringType(), False), StructField("dst", StringType(), False), StructField("relation_name", StringType(), False), StructField("src_type", StringType(), False), StructField("dst_type", StringType(), False)
]) # we will use the length of the vertice schemas to parse the graph from the json files appropriately:
len(vertex_schema), len(vertex_schema_with_attr)
